import React, { useState} from "react";

function LoginPage(){
    const [loginId, setLoginId] = useState("");
    const [password, setPassword] = useState("");

    const getLoginId = (e) => {
        setLoginId(e.target.value)
        console.log("id :: " + e.target.value());
    }
    const getPassword = (e) => {
        setPassword(e.target.value)
        console.log("pwd :: " + e.target.value());
    }


    return(
        <div>
            <h2>여기는 로그인 페이지 </h2>
            <input type='text' placeholder='ID' id={loginId} onChange={getLoginId}/><br/><br/>
            <input type='text' placeholder='PASSWORD' id={password} onChange={getPassword}/><br/><br/>
            <button>로그인</button>
        </div>
    )
}
export default LoginPage;
